import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/layout/Navbar';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Navbar />
        </div>
      </Switch>
    </Router>
  );
}

export default App;
